CREATE PROCEDURE [GetEstudiosRelPorOrganismoId]
    @organismoId [int]
AS
BEGIN
     	
    Select toe.EstudioDto_Id as EstudioRelacionId,te.Nombre as Estudio
    from tOrganismosEstudiosRel toe
    inner join tOrganismos tor
    on  toe.OrganismoDto_Id = tor.Id
    and tor.Id = @organismoId
    inner join tEstudios te
    on toe.EstudioDto_Id = te.Id
    
END
