CREATE PROCEDURE [GetEventsByDenunciaId]
    @denunciaId [int]
AS
BEGIN
     	
    Select te.EventoId,te.Fecha,tt.Nombre as tipoEvento,te.Observacion,te.CONTESTADO,ts.Nombre as Solucionado,tr.Nombre as RequerimientoInforme  from teventos te
    inner join tTipoEvento tt
    on te.tipoEvento = tt.Id
    and te.DenunciaId = @denunciaId
    left join tSolucionado ts
    on te.SOLUCIONADO = ts.Id
    left join tReqInforme tr
    on te.REQUERIMIENTOINFORME = tr.Id 
    order by te.EventoId desc
    
END
