CREATE PROCEDURE [GetGrupoDenunciantesPorIdGrupo]
    @grupoId [int]
AS
BEGIN
     	
    Select GD.GrupoDto_Id,td.DenuncianteId,td.nombre as Nombre,td.apellido as Apellido,td.NroDocumento as DNI from 
    GrupoDenunciantesRel GD
    inner join tDenunciantes td
    on GD.DenuncianteDto_DenuncianteId = td.DenuncianteId
    and GD.GrupoDto_Id = @grupoId
    
END
